  false,\n\t\"url\": null,\n\t\"notes\": \"Aerial surveys at five black brant colonies
  on the Yukon-Kuskokwim Delta--KokechikBay (KB), Tutakoke River (TR), Kigigak Island
  (KI), Baird Inlet Island (BI), and a peninsula northwest of Baird Inlet Island (BP)
  were conducted from 8-12 June. Good weather and improved procedures resulted in
  the most efficient data collection since the surveys began in 1991.\",\n\t\"license_title\":
